      stem: deanslist_student_misc
      suffix: json
    destination_config:
      name: deanslist
  - query_config:
      type: schema
      value:
        table:
          name: rpt_deanslist__transcript_gpas
          schema: kipptaf_extracts
    file_config:
      stem: deanslist_transcript_gpas
      suffix: json
    destination_config:
      name: deanslist
  - query_config:
      type: schema
      value:
        table:
          name: rpt_deanslist__transcript_grades
          schema: kipptaf_extracts
    file_config:
      stem: deanslist_transcript_grades
      suffix: json
    destination_config:
      name: deanslist
    op_tags:
      dagster-k8s/config:
        container_config:
          resources:
            requests:
              memory: 1.0Gi
